entry.value:
import groovy.json.JsonSlurper
import groovy.json.JsonBuilder

TimeZone.setDefault(TimeZone.getTimeZone('UTC'))

def ff = session.get()
if(!ff)return
ff = session.write(ff, {rawIn, rawOut->
    // transform streams into reader and writer
    rawIn.withReader("UTF-8"){reader->
        rawOut.withWriter("UTF-8"){writer->
            //parse reader into Map
            def json = new JsonSlurper().parse(reader)
            //change/set values
            if (json.start != null) {
                json.start = new Date((json.start as Long) * 1000).format("yyyy-MM-dd'T'HH:mm:ss.SSS'Z'")
            }
            if (json.end != null) {
                json.end = new Date((json.end as Long) * 1000).format("yyyy-MM-dd'T'HH:mm:ss.SSS'Z'")
            }
            new JsonBuilder(json).writeTo(writer)
        }
    }
} as StreamCallback)
session.transfer(ff, REL_SUCCESS)
